import React from 'react';  
import axios from 'axios'; 

class listaDiretorios extends React.Component {  
    constructor() {  
        super();  
        this.state = {  
            DiretoriosData: []  
        }  
    }  
  
    componentDidMount() {  
        axios.get("http://localhost:49548/api/diretorios").then(response => {  
            //console.log(response.data);  
            this.setState({  
                DiretoriosData: response.data  
            });  
        });  
    }  
  
    render() {  
  
        return (  
            <section>  
                <h1>Diretorios List</h1>  
                <div>  
                    <table>  
                        <thead><tr><th>Id</th><th>Name</th></tr></thead>  
                        <tbody>  
                            {  
                                this.state.DiretoriosData.map((p, index) => {  
                                    return <tr key={index}><td>{p.DiretorioId}</td><td> {p.NomeDiretorio}</td></tr>;  
                                })  
                            }  
                        </tbody>  
                    </table>  
                </div>  
  
  
            </section>  
        )  
    }  
}  
  
ReactDOM.render(  
    <listaDiretorios />,  
    document.getElementById('myContainer'));
